import React, { Component } from 'react'
import { Navbar, Nav } from 'react-bootstrap'
import { Link } from 'react-router-dom'
import Service from '../../service/Auth.service'

class Navigation extends Component {

  constructor(props) {
    super(props)
    this._service = new Service()
  }



  render() {

    const saludo = this.props.loggedInUser ? this.props.loggedInUser.username : 'invitado'

    if (this.props.loggedInUser){
      if (this.props.loggedInUser.role === 'creator') {

        return (
          <Navbar bg="dark" variant="dark" expand="md">
              <Navbar.Brand>Show Home!</Navbar.Brand>
              <Navbar.Toggle aria-controls="basic-navbar-nav" />
              <Navbar.Collapse>
                  <Nav className="mr-auto">
                      {/* <Nav.Link as="li"><Link to="/">Inicio</Link></Nav.Link> */}
                      <Nav.Link as="li"><Link to="/profile/creator">Mi perfil</Link></Nav.Link>
                      <Nav.Link as="li"><Link to="/profile/events">Mis Eventos</Link></Nav.Link>
                      <Nav.Link as="li"><Link to="/plans">Planes</Link></Nav.Link>
                      <Nav.Link as = "li" >< Link to = "/busqueda" > Busqueda </Link></Nav.Link >
                      <Nav.Link as="li"> <Link onClick={this.logout}>Logout</Link></Nav.Link>
                  </Nav>
                  <Nav className="ml-auto">
                      <Navbar.Text>Bienvenid@ {saludo}</Navbar.Text>
                  </Nav>
              </Navbar.Collapse>
          </Navbar>
        )
      }
      else if (this.props.loggedInUser.role === 'host') {

        return (
          <Navbar bg="dark" variant="dark" expand="md">
              <Navbar.Brand>Show Home!</Navbar.Brand>
              <Navbar.Toggle aria-controls="basic-navbar-nav" />
              <Navbar.Collapse>
                  <Nav className="mr-auto">
                      <Nav.Link as="li"><Link to="/profile/host">Mi perfil</Link></Nav.Link>
                      <Nav.Link as="li"><Link to="/profile/spaces">Mis Espacios</Link></Nav.Link>
                      <Nav.Link as = "li" > < Link to = "/plans" > Planes </Link></Nav.Link >
                      <Nav.Link as = "li" > < Link to = "/busqueda" > Busqueda </Link></Nav.Link >
                      <Nav.Link as="li" onClick={this.logout}>Logout</Nav.Link>
                      {/* <Nav.Link as="li"><Link to="/">Inicio</Link></Nav.Link> */}
                      {/* <Nav.Link as="li"><Link to="/plans">Planes</Link></Nav.Link> */}
                      {/* <Nav.Link as="li"><Link to="/signup">Registro</Link></Nav.Link>
                      <Nav.Link as="li"><Link to="/login">Login</Link></Nav.Link> */}
                  </Nav>
                  <Nav className="ml-auto">
                      <Navbar.Text>Bienvenid@ {saludo}</Navbar.Text>
                  </Nav>
              </Navbar.Collapse>
          </Navbar>
        )  
      }
      else  {
        return (
          <Navbar bg="dark" variant="dark" expand="md">
              <Navbar.Brand>Show Home!</Navbar.Brand>
              <Navbar.Toggle aria-controls="basic-navbar-nav" />
              <Navbar.Collapse>
                  <Nav className="mr-auto">
                      {/* <Nav.Link as="li"><Link to="/">Inicio</Link></Nav.Link>
                      {/* <Nav.Link as="li"><Link to="/plans">Planes</Link></Nav.Link> */}
                      {/* <Nav.Link as="li"><Link to="/signup">Registro</Link></Nav.Link>
                      <Nav.Link as="li"><Link to="/login">Login</Link></Nav.Link> */}
                        <Nav.Link as="li"><Link to="/profile/explorer">Mi perfil</Link></Nav.Link>
                        <Nav.Link as = "li" > < Link to = "/busqueda" > Busqueda </Link></Nav.Link >
                        <Nav.Link as = "li" > < Link to = "/Plans" > Planes </Link></Nav.Link >
                <Nav.Link as="li" to="">Logout</Nav.Link>
                  </Nav>
                  <Nav className="ml-auto">
                      <Navbar.Text>Bienvenid@ {saludo}</Navbar.Text>
                  </Nav>
              </Navbar.Collapse>
          </Navbar>
        )
      }
    }
    else {
  return(
     <Navbar bg="dark" variant="dark" expand="md">
              <Navbar.Brand>Show Home!</Navbar.Brand>
              <Navbar.Toggle aria-controls="basic-navbar-nav" />
              <Navbar.Collapse>
                  <Nav className="mr-auto">
                      {/* <Nav.Link as="li"><Link to="/">Inicio</Link></Nav.Link>
                      {/* <Nav.Link as="li"><Link to="/plans">Planes</Link></Nav.Link> */}
                      <Nav.Link as="li"><Link to="/signup">Registro</Link></Nav.Link>
                      <Nav.Link as="li"><Link to="/login">Login</Link></Nav.Link>
                      {/* <Nav.Link as="li" onClick={this.logoutUser}>Logout</Nav.Link> */}
                  </Nav>
                  {/* <Nav className="ml-auto">
                      <Navbar.Text>Bienvenid@ {saludo}</Navbar.Text>
                  </Nav> */}
              </Navbar.Collapse>
          </Navbar>
  )
}
}
}






